import React, {useState, useEffect} from "react"

import axios from 'axios'


function Scoreboard() {

    useEffect(() => {
        axios.get('http://localhost:5000/scoreboard/')
        .then(response => {
            console.log(response.data[0].score)
            
        })
        .catch((error) => {
            console.log(error)
        })

    },[])
    

 
    
    return(
        <div>
            <h1>Scoreboard</h1>

        </div>
    )
}

export default Scoreboard
